 "Ἰσκαριώτης": "<b>Ἰσκαριώτης, ου, ὁ</b> : <span style='color:red'>Nom</span>, <span style='color:red'>Masculin</span><br><u>EN 1</u> : Iscariot, surname of Judas and his father<br><u>EN 2</u> : Iscariot, surname of Judas.<br><u>FR 1</u> : Iscariote, nom de famille de Judas et de son père<br><u>FR 2</u> : Iscariote, nom de famille de Judas.",
 "ἴσος": "<b>ἴσος, η, ον</b> : <span style='color:red'>Adjectif</span><br><u>EN 1</u> : equal<br><u>EN 2</u> : equal, equivalent, identical.<br><u>FR 1</u> : égal<br><u>FR 2</u> : égal, équivalent, identique.",
