 "ἰσόψυχος": "<b>ἰσόψυχος, ον</b> : <span style='color:red'>Adjectif</span><br><u>EN 1</u> : like-minded<br><u>EN 2</u> : like-minded, of the same mind or spirit.<br><u>FR 1</u> : partageant les mêmes idées<br><u>FR 2</u> : partageant les mêmes idées, du même esprit ou esprit.",
 "Ἰσραήλ": "<b>Ἰσραήλ, ὁ</b> : <span style='color:red'>Nom Propre Indéclinable</span><br><u>EN 1</u> : Israel, the name of the Jewish people and their land<br><u>EN 2</u> : (Hebrew), Israel, surname of Jacob, then the Jewish people, the people of God.<br><u>FR 1</u> : Israël, le nom du peuple juif et sa terre<br><u>FR 2</u> : (Hébreu), Israël, nom de famille de Jacob, puis le peuple juif, le peuple de Dieu.",
 "Ἰσραηλίτης": "<b>Ἰσραηλίτης, ου, ὁ</b> : <span style='color:red'>Nom</span>, <span style='color:red'>Masculin</span><br><u>EN 1</u> : an Israelite<br><u>EN 2</u> : an Israelite, one of the chosen people of Israel, a Jew.<br><u>FR 1</u> : un Israélite<br><u>FR 2</u> : un Israélite, un des élus d'Israël, un Juif.",
 "ἵστημι": "<b>ἵστημι</b> : <span style='color:red'>Verbe</span><br><u>EN 1</u> : to make to stand, to stand<br><u>EN 2</u> : trans: (a) I make to stand, place, set up, establish, appoint; mid: I place myself, stand, (b) I set in balance, weigh; intrans: (c) I stand, stand by, stand still; met: I stand ready, stand firm, am steadfast.<br><u>FR 1</u> : faire se tenir debout<br><u>FR 2</u> : trans: (a) je fais pour me lever, placer, installer, établir, nommer; au milieu: je me place, me lève, (b) je mets en équilibre, je pèse; intrans: (c) Je me tiens, me tiens prêt, me tiens toujours debout; rencontré: je suis prêt, ferme, je suis ferme.",
 "ἱστορέω": "<b>ἱστορέω</b> : <span style='color:red'>Verbe</span><br><u>EN 1</u> : to inquire about, visit<br><u>EN 2</u> : I get acquainted with, visit.<br><u>FR 1</u> : pour en savoir davantage, visitez<br><u>FR 2</u> : Je fais connaissance, visite.",
 "ἰσχυρός": "<b>ἰσχυρός, ά, όν</b> : <span style='color:red'>Adjectif</span><br><u>EN 1</u> : strong, mighty<br><u>EN 2</u> : strong (originally and generally of physical strength); mighty, powerful, vehement, sure.<br><u>FR 1</u> : fort, puissant<br><u>FR 2</u> : forte (à l'origine et généralement de force physique); puissant, puissant, véhément, bien sûr.",
 "ἰσχύς": "<b>ἰσχύς, ύος, ἡ</b> : <span style='color:red'>Nom</span>, <span style='color:red'>Féminin</span><br><u>EN 1</u> : strength, might<br><u>EN 2</u> : strength (absolutely), power, might, force, ability.<br><u>FR 1</u> : force, pourrait<br><u>FR 2</u> : force (absolument), puissance, puissance, force, capacité.",
 "ἰσχύω": "<b>ἰσχύω</b> : <span style='color:red'>Verbe</span><br><u>EN 1</u> : to be strong, have power<br><u>EN 2</u> : I have strength, am strong, am in full health and vigor, am able; meton: I prevail.<br><u>FR 1</u> : être fort, avoir le pouvoir<br><u>FR 2</u> : J'ai la force, je suis fort, je suis en pleine santé et vigueur, je suis capable; meton: je l'emporte.",
 "ἴσως": "<b>ἴσως</b> : <span style='color:red'>Adverbe</span><br><u>EN 1</u> : perhaps<br><u>EN 2</u> : perhaps, equally; it may be that.<br><u>FR 1</u> : peut-être<br><u>FR 2</u> : peut-être également; il se peut que.",
 "Ἰταλία": "<b>Ἰταλία, ας, ἡ</b> : <span style='color:red'>Nom</span>, <span style='color:red'>Féminin</span><br><u>EN 1</u> : Italy, a region of western Europe<br><u>EN 2</u> : Italy.<br><u>FR 1</u> : L'Italie, une région d'Europe occidentale<br><u>FR 2</u> : Italie.",
