 "ἰχθύδιον": "<b>ἰχθύδιον, ου, τό</b> : <span style='color:red'>Nom</span>, Neuter<br><u>EN 1</u> : a little fish<br><u>EN 2</u> : a small fish.<br><u>FR 1</u> : un petit poisson<br><u>FR 2</u> : un petit poisson.",
