 "τοίνυν": "<b>τοίνυν</b> : <span style='color:red'>Particule</span>, Disjunctive <span style='color:red'>Particule</span><br><u>EN 1</u> : accordingly, therefore<br><u>EN 2</u> : indeed now, therefore, accordingly, well then.<br><u>FR 1</u> : en conséquence, donc<br><u>FR 2</u> : en effet maintenant, donc, en conséquence, bien alors.",
