 "τοῖχος": "<b>τοῖχος, ου, ὁ</b> : <span style='color:red'>Nom</span>, <span style='color:red'>Masculin</span><br><u>EN 1</u> : a wall<br><u>EN 2</u> : a wall.<br><u>FR 1</u> : un mur<br><u>FR 2</u> : un mur.",
