 "τολμάω": "<b>τολμάω</b> : <span style='color:red'>Verbe</span><br><u>EN 1</u> : to have courage, to be bold<br><u>EN 2</u> : I dare, endure, am bold, have courage, make up the mind.<br><u>FR 1</u> : avoir du courage, être audacieux<br><u>FR 2</u> : J'ose, j'endure, je suis audacieux, j'ai du courage, je me décide.",
