 "χιλίαρχος": "<b>χιλίαρχος, ου, ὁ</b> : <span style='color:red'>Nom</span>, <span style='color:red'>Masculin</span><br><u>EN 1</u> : a chiliarch, a commander of a thousand<br><u>EN 2</u> : a commander of a thousand men, a military tribune.<br><u>FR 1</u> : un chiliarque, un commandant de mille<br><u>FR 2</u> : un commandant de mille hommes, une tribune militaire.",
 "χίλιοι": "<b>χίλιοι, αι, α</b> : <span style='color:red'>Adjectif</span><br><u>EN 1</u> : a thousand<br><u>EN 2</u> : a thousand.<br><u>FR 1</u> : un millier<br><u>FR 2</u> : un millier.",
 "Χίος": "<b>Χίος, ου, ἡ</b> : <span style='color:red'>Nom</span>, <span style='color:red'>Féminin</span><br><u>EN 1</u> : Chios, an island in the Aegean Sea<br><u>EN 2</u> : Chios (modern Scio), an important island in the Aegean Sea, off the west central coast of Asia Minor.<br><u>FR 1</u> : Chios, une île de la mer Égée<br><u>FR 2</u> : Chios (Scio moderne), une île importante de la mer Égée, au large de la côte centrale ouest de l'Asie Mineure.",
 "χιτών": "<b>χιτών, ῶνος, ὁ</b> : <span style='color:red'>Nom</span>, <span style='color:red'>Masculin</span><br><u>EN 1</u> : a tunic<br><u>EN 2</u> : a tunic, garment, undergarment.<br><u>FR 1</u> : une tunique<br><u>FR 2</u> : une tunique, un vêtement, un sous-vêtement.",
 "χιών": "<b>χιών, όνος, ἡ</b> : <span style='color:red'>Nom</span>, <span style='color:red'>Féminin</span><br><u>EN 1</u> : snow<br><u>EN 2</u> : snow.<br><u>FR 1</u> : neige<br><u>FR 2</u> : neige.",
 "χλαμύς": "<b>χλαμύς, ύδος, ἡ</b> : <span style='color:red'>Nom</span>, <span style='color:red'>Féminin</span><br><u>EN 1</u> : a chlamys or short cloak<br><u>EN 2</u> : a short cloak, worn by military officers and soldiers.<br><u>FR 1</u> : une chlamys ou une courte cape<br><u>FR 2</u> : un manteau court, porté par les officiers militaires et les soldats.",
 "χλευάζω": "<b>χλευάζω</b> : <span style='color:red'>Verbe</span><br><u>EN 1</u> : to jest, mock, jeer<br><u>EN 2</u> : I mock, scoff, jest, jeer.<br><u>FR 1</u> : plaisanter, se moquer, se moquer<br><u>FR 2</u> : Je me moque, me moque, je plaisante, je me moque.",
 "χλιαρός": "<b>χλιαρός, ά, όν</b> : <span style='color:red'>Adjectif</span><br><u>EN 1</u> : tepid, warm<br><u>EN 2</u> : warm, tepid; of persons: lukewarm.<br><u>FR 1</u> : tiède, chaud<br><u>FR 2</u> : chaud, tiède; personnes: tiède.",
 "Χλόη": "<b>Χλόη, ης, ἡ</b> : <span style='color:red'>Nom</span>, <span style='color:red'>Féminin</span><br><u>EN 1</u> : Chloe<br><u>EN 2</u> : Chloe, probably with business connections either in Corinth or in Ephesus or in both.<br><u>FR 1</u> : Chloe<br><u>FR 2</u> : Chloé, probablement avec des relations d'affaires à Corinthe ou à Ephèse ou les deux.",
